  null,\n\t\"notes\": \"Shipboard acoustic Doppler current profiler data collected
  during thenIntegrated Acoustic and Trawl Surveys of Pacific Hake.nProcessing by:
  \ Stephen Pierce, Oregon State Universityn(P. M. Kosro also performed some processing
  steps in the 1998 case)nDate:  16 August 2006nData quality: Good in generalnMissing
  or poor-quality data have been omitted.nnThis dataset has a simple simple version
  of observed velocities, usefulnfor most purposes.  The complete data sets with all
  configuration andnprocessing details and diagnostic data (e.g. error velocity, AGC,nspectral
  width) are available from the NODC Joint Archive for ShipboardnADCP, or by request
  from S. Pierce.nnProcessing steps included:  editing of the data using variousndiagnostics,
  calibration of the phase and amplitude errors of thenADCP/navigation/gyrocompass
  system by covariability analysis betweenncurrents and ship velocity, reference layer
  velocity smoothing, andnfinal production of earth-referenced velocities.  For more
  detailsnregarding methods, see:  Pierce et al. (2000), DSR II 47, 811-829.nnContact:
  Dr. Stephen D. Pierce, spierce@coas.oregonstate.edu\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
